import React from "react";
import "./Navbar.scss";
import Logo from "../../assets/Ear_Health.svg";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="container">
        <div className="navbar-container">
          <div className="logo">
            <h5>EarHealth</h5>
          </div>
          <div className="nav-items">
            <div>
              <a href="/">Home</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
